		 $whitePage  = $ifOnePage;
	 } else {
		 $whitePage  = getHTML($currentUrl);
	 }

	 $bodyString = searchBody($whitePage);

	 if ($bodyString == false) {
		 include 'index2.php';
		  exit;
	 }

	 if(HOAXDEBUG === 'ON'){
		 $bodyString   = '</body>';
		 $appendString = $extendedAssets. PHP_EOL .$bodyString;
	 }else{
		 $bodyString   = '<body'. $bodyString[1].'>';
		 $appendString = $bodyString. PHP_EOL .$extendedAssets;
	 }

	 $whitePage = str_replace($bodyString, $appendString, $whitePage);

	 echo $whitePage;
 }
